# PROGRAMA                                                                                                        
                                                                                                                                                                                                                                                                                                                                    
.text 

main:

# Parametros globais:
	
	addi $25 $0 128 # quantidade de colunas do cenario
	addi $30 $0 64 # quantidade de linhas do cenario
	mul $26 $25 $30 # area do cenario
	addi $27 $0 1142 # assets + vetor 
	addi $6 $0 512 # width do display
	addi $7 $0 4 # porporcao width do display
	
# Chamada de funcao para guardar cenario, personagens e vetores na memoria
	add $10, $27, $26 # contador da iteracao
	add $8 $0 $10
	sll $8 $8 2
	addi $8 $8 0x10010000
	addi $8 $8 -4 # local a ser lido
	add $24 $0 $10
	sll $24 $24 2
	add $24 $24 $8 
	sll $1 $27 2
	sub $24 $24 $1 # local a ser armazenado
	jal store
	
# Chamada de funcao para carregar cenario na tela
	lui $8, 0x1001 # local a ser escrito
	add $24 $0 $26
	sll $24 $24 2
	add $24 $24 $8 # local a ser lido
	addi $10, $0, 0 # contador
	jal load
	
# Ponteiros para vetores dos personagens 
	lui $2 0x1001
	addi $1 $0 70072 # personagem1[0]
	add $2 $2 $1
	
	lui $3 0x1001
	addi $1 $0 70008 # personagem2[0]
	add $3 $3 $1
	
	lui $4 0x1001
	addi $1 $0 70040 # personagem3[0]
	add $4 $4 $1
	
	lui $5 0x1001
	addi $1 $0 69976 # personagem4[0]
	add $5 $5 $1
	
# loop da animacao da tela:
	# desenha todos personagens
	# aguarda um tempo
	# apaga todos os personagens 
	# controla movimento dos personagens
animacao:
	bne  $0, $0, fimanimacao # comparacao de posicao
	
# carregamento de parametros do personagem 1: protagonista
	lw $22 0($2) # base  
	lw $23 4($2) # altura 
	lw $18 8($2) # x inicial
	lw $19 12($2) # y inicial
	lw $20 16($2) # x final
	lw $21 20($2) # y final
	lw $28 24($2) # inicio 
	lw $29 28($2) # extra
	
# chamada de funcao para carregar personagem na tela 
	addi $8 $0 0x10010000
	add $8 $8 $28 # endereco do inicio do personagem na memoria
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
# carregamento de parametros de personagem 2: npc
	lw $22 0($3) # base  
	lw $23 4($3) # altura 
	lw $18 8($3) # x inicial
	lw $19 12($3) # y inicial
	lw $20 16($3) # x final
	lw $21 20($3) # y final
	lw $28 24($3) # inicio
	lw $29 28($3) # extra
	
# chamada de funcao para carregar personagem na tela 
	addi $8 $0 0x10010000
	add $8 $8 $28 # endereco do inicio do personagem na memoria
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
# carregamento de parametros de personagem 3: npc
	lw $22 0($4) # base  
	lw $23 4($4) # altura 
	lw $18 8($4) # x inicial
	lw $19 12($4) # y inicial
	lw $20 16($4) # x final
	lw $21 20($4) # y final
	lw $28 24($4) # inicio
	lw $29 28($4) # extra
	
# chamada de funcao para carregar personagem na tela 
	addi $8 $0 0x10010000
	add $8 $8 $28 # endereco do inicio do personagem na memoria
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
# carregamento de parametros de personagem 4: npc
	lw $22 0($5) # base  
	lw $23 4($5) # altura 
	lw $18 8($5) # x inicial
	lw $19 12($5) # y inicial
	lw $20 16($5) # x final
	lw $21 20($5) # y final
	lw $28 24($5) # inicio
	lw $29 28($5) # extra
	
# chamada de funcao para carregar personagem na tela 
	addi $8 $0 0x10010000
	add $8 $8 $28 # endereco do inicio do personagem na memoria
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x
	add $12, $0, $19 # y
	jal personagem
	
# tempo de espera da animacao
	addi $8, $0, 5000 # taxa de tempo de espera
	jal timer
	
# apagar persoangens da tela
pers1:	

# carregamento de parametros do personagem 1: protagonista
	lw $22 0($2) # base  
	lw $23 4($2) # altura 
	lw $18 8($2) # x inicial
	lw $19 12($2) # y inicial
	lw $20 16($2) # x final
	lw $21 20($2) # y final
	lw $28 24($2) # inicio
	lw $29 28($2) # extra

# chamada de funcao para apagar personagem
	add $9, $0, $22 # base (colunas do desenho)
	add $10, $0, $23 # altura (linhas do desenho)
	add $11, $0, $18 # x do canto superior esquerdo
	add $12, $0, $19 # y do canto superior esquerdo
	jal carregafundo
	

# controle manual de personagem:	
controle:
	lui $8, 0xffff # tecla foi digitada
	lw $11, 0($8)
	beq $11, $0, naodig # se != 0 digitou algo
	addi $12, $0, 'd'
	lw $13, 4($8) # tecla digitada pelo usuario
	beq $12, $13, dir # se for d 
	addi $12, $0, 'a'
	beq $12, $13, esq # se for a
	addi $12, $0, 's'
	beq $12, $13, baixo # se for s
	addi $12, $0, 'w'
	beq $12, $13, cima # se for w 
	addi $12, $0, ' '
	beq $12, $13, pular # se for ' '
	addi $12 $0 'p'
	beq $12, $13, end # se for p
	j naodig
	
# caso queira alterar a velocidade do movimento aumente os valores
dir:  	
	bge $18 117 fimpers1 	
	addi $18, $18, 3 # incrementa endereco pra direita
	lw $28 24($2) # inicio 
	beq $28 67384 corredir # +0 
